import React from 'react'
import Game from '../Game'

const games = "https://api.rawg.io/api/games?key=d0fe4ae2d91e4d78953d1fbde5166610&page_size=10"
console.log(games)

const GamesList = (props) => {
  const { searchValue } = props
    return (
        <div id="list">
        {games.data.result.filter((selectedGame) => selectedGame.name.includes(searchValue)).map((game) => (<Game name={game.name} genre={game.genre} mode={game.mode} />))}
        </div>
    )

}

export default GamesList
